import React, { Component } from 'react';
import { Container,Navbar,NavbarBrand,Button,label} from 'reactstrap';

class LeftComponent extends Component {
    render() {
        var resultRows = this.props(function(result){
            return (
                <tbody>
                     <tr>
                         <td><input type="radio" name="site_name" value={result.SITE_NAME}>{result.SITE_NAME}</input></td>
                         <td><input type="radio" name="address" value={result.ADDRESS}>{result.ADDRESS}</input></td>
                     </tr>
                </tbody>
            );
        });


        return (
            <div>
                <input type="text" placeholder="Search.."></input> 

                <table className="table">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Address</th>
                        </tr>
                    </thead>
                        {resultRows}
                    <tfoot>
                        <tr>
                            <td>chosen site name ???? </td>
                            <td>chosen address ????? </td>
                        </tr>
                    </tfoot>
                </table>


            </div>
        );
    }
}

export default LeftComponent;
